import React, { Component } from 'react'

export class header extends Component {
    render() {
        return (
           <form>
               <label>
                   <input type="text" value={'test1'} />
               </label>
               <label>
                   <input type="text" value={'test2'} />
               </label>
           </form>
        )
    }
}

export default header
